css:
@-moz-document domain("www.gnotes.me") {

  body, #modal
  {
    color: #fff !important;
    background-color: #333 !important;
    background: #333 !important;
  }
    
  .item, .nav-list > .active > a
  {
    color: #fff !important;
    background-color: #666 !important;
    background: #666 !important;
  }
    
  h5, .item_text
  {
    color: #fff !important;
  }
    
  .nav-list .divider, #edit_buttons, #trash_buttons, #note_ta_text, #note_div_text
  {
    color: #fff !important;
    border: none !important;
    border-bottom: 2px solid #98C01C !important;
    background: #666 !important;
  }
    
  #checklist_title, #checklist_ul .content
  {
    color: #fff !important;
    border: none !important;
    background: #666 !important;
  }

}
